(19, 'Shipping and Replacement', '<h3>\r\nDelivery Policy\r\n</h3>\r\n<p>\r\nBengalfish.com.bd opens the doorway for everybody to shop over the Internet. Our dedicated Bengal Fish quality assurance team works round the clock personally to make sure the right packages reach on time. Our services are at your doorsteps with low delivery charge. We process all deliveries through Own courier services as well as our in-house delivery team. We deliver products all over the Bangladesh as well as the world. If there is any modification in delivery charge for a particular item, it is mentioned in product details.\r\nOrder confirmation and delivery completion are subject to product availability. Delivery time may differ from one item to another. It can differ from standard delivery to beyond that.\r\nStandard Delivery: If your delivery address is within Dhaka city, products will be delivered by within 24 hours. If it is outside Dhaka, it will take 48 Hours.\r\nExceptional Delivery: There are some exceptional items that we import from outside Bangladesh. These items can take 2-3 or more days to reach you. However, you will receive your order within the time specified.\r\n</p>\r\n<p>\r\nYou can make your purchases on Bengalfish.com.bd and get delivery from anywhere in the world. Delivery charge varies according to customers\' country. In case of paid order, Bengalfish.com.bd cannot be held liable if customer does not receive it within 2 months.\r\n</p>\r\n<h3> \r\nReplacement Guarantee\r\n</h3>\r\n<p>\r\nWe provide great customer experience each time you shop with your Bengalfish.com.bd. If you are not satisfied with your purchase, we ensure ‘Replacement Guarantee’. We will replace your purchased product if the product has any defect by its quality or if the product is not the same one you ordered. Please check your products in front of riders or in house delivery time.\r\nAll you need to do is give us a call our hotline:09613-850850 or drop an email at support@bengalfish.com.bd within a period of 24 hours from the date of delivery. However, please return the product with the tags intact and in their original packaging, in an unwashed and undamaged condition. Replacement for products is subject to inspection and checking by Bengal Fish support team.\r\n</p>\r\n<p>\r\nWe give the option of taking back the product from your doorstep at Dhaka. If reverse pickup is not possible from your doorstep, you can send it by courier to our office address (Corporate Head Office : Room: 02, (1st Floor), TJM Complex, 146, Manipuri para, Tejgaon, Dhaka-1215 .\r\ncustomer can choose any other product from our website or can keep the amount debited to his wallet account. In case of refunding card payment, Bkash, Rocket, Nagad the refund will be returned directly to the customer\'s debit/credit card if customer claims a refund to his bank. Then we will be informed about it via SSLCommerzBD and take necessary initiatives. Card payment can be refunded only to the card holder\'s account via bank and cannot be refunded partially as per policy.\r\n</p>\r\n\r\n<h3> \r\nSecurity Policy\r\n</h3>\r\n<p>\r\nWe are committed to ensure the security of your information. We maintain suitable physical, electronic and managerial procedures to safeguard and secure your information by preventing unauthorized access. Read here how we use cookies, debit/credit cards, other websites and contents.\r\n</p>\r\n\r\n<h3>\r\nHow we use cookies:\r\n</h3>\r\n<p>\r\nA cookie is a small file which asks permission to be placed on your computer\'s hard drive. Cookies allow web applications to respond to you as an individual. The web application can tailor its operations to your needs, likes and dislikes by gathering and remembering information about your preferences. We only use this information for statistical analysis purposes and then the data is removed from the system. A cookie in no way gives us access to your computer or any information about you, other than the data you choose to share with us.\r\nUse of credit/debit cards:\r\n</p>\r\n<p>\r\nShopping at Bengal Fish is 100% safe. All Credit card and Debit card payments on Bengal Fish are processed through secure and trusted payment gateways. When you transact here, you pay at the payment page which is incorporated with your respected bank. So, your bank deals with your credit/debit card information. You can be assured that Bengal Fish offers you the highest standards of security currently available on the internet so as to ensure that your shopping experience is private, safe and secure.\r\nLinks to other websites:\r\n</p>\r\n<p>\r\nOur website may contain links to other websites of interest. However, once you have used these links to leave our site, you should note that we do not have any control over the other websites. Therefore, we cannot be responsible for the protection and privacy of any information which you provide whilst visiting such sites. We provide security only at our website. \r\n</p>\r\n\r\n<h3>\r\nContent you submit:\r\n</h3>\r\n<p>\r\nYou agree that any information submitted belongs to you or you have permission to submit them. Content means but is not restricted to text, graphics, photos, logos, audio/video files etc. You agree to indemnify us from all responsibility and not hold us responsible for displaying any information you submit to us.\r\n</p>\r\n', 1, 7),
(22, 'About Us', '<h1><strong>Bengal Fish About us</strong></h1>\r\n\r\n<p><a href=\\\"\\\\\\\">Bengal fish</a> is an <a href=\\\"\\\\\\\">online fish store in Bangladesh</a> for fresh fish that delivers to your doorstep. We are on a mission of providing clean, well packed, fresh fishes for your daily consumption. Most of the local fish shops are not clean enough or even worse supply stale fish. Bengal fish offer two things&rsquo; firstly fresh fish, secondly convenience. So you won&rsquo;t have the trouble of physically going to market and choose one among hundreds. Instead, get fishes of all kinds delivered to your address overnight.&nbsp;</p>\r\n\r\n<p>We supply a wide range of ready to eat fish in Dhaka. We are the ultimate online platform where we provide <a href=\\\"\\\\\\\">live fish</a>, <a href=\\\"\\\\\\\">dry fish</a>, <a href=\\\"\\\\\\\">imported</a>, <a href=\\\"\\\\\\\">frozen</a>, fresh, prepared to <a href=\\\"\\\\\\\">cook fishes</a>. Our on-demand delivery service in Dhaka is changing the conventional fish market industry.&nbsp; We ensure hygienic fresh products, fast delivery to make an impact. Bengal fish has huge varieties of fishes to choose from at great prices. Our reliable service promises the finest quality fish,&nbsp; freshness and quick delivery. We take all the necessary steps to make sure you have a great experience when buying fish from Bengal fish. It is our guaranteed fresh product, transparent price and minimum delivery charges which set us apart.&nbsp;</p>\r\n\r\n<h2><strong>Our mission</strong></h2>\r\n\r\n<p>Bengal fish is on a mission to deliver healthy, high-quality fish to the residence in Dhaka. Our mission and the core principle is to bring a change without compromising on quality. We aim to make fishes fresh from the shore available to everyone.&nbsp;</p>\r\n\r\n<h2><strong>Our vision</strong></h2>\r\n\r\n<p>Our vision is to satisfy our customers with our transparent, ethical services. We empower the local fishermen with sound incomes. We try to build a regular, loyal customer base with performance-driven products and services.&nbsp; Our delivery outflow is meant to change the way customers have been buying fish all this time.</p>', 1, 8),
(24, 'Bengal Fish Online Shop', '<h1><strong>Bengal Fish Who we are?</strong></h1>\r\n\r\n<p>Fish is ingrained in our culture. And we all love to fish. Still, the most common complaint is that there is no reliable source of fresh non-preservative fish in the market. That is why Bengal Fish started our journey recently only with the only motive of being a trustable supplier of fresh fish online. Our products and services are so distinct that we promise you will not look elsewhere once you receive our service.&nbsp;</p>\r\n\r\n<p>At Bengal Fish, we are driven by the motive of providing you with fresh fish at a reasonable cost with a fast delivery service.</p>\r\n\r\n<h2><strong>Our Fish Categories and Collection in BD&nbsp;</strong></h2>\r\n\r\n<p>Our fish collection consists of a few categories such as dry fish, fresh live fish, sea fish. It is no surprise that we supply a vast variety of fish in Bangladesh. We aim to deliver live freshly caught fish from local rivers and sea. Point to be noted that we do not hold any stock of live fish. We only collect them after receiving your orders. &nbsp; We supply the following fish in Bangladesh.</p>\r\n\r\n<p>TANGRA, DRY LOITTA, DRY PUTI, DRY CHEPA, DRY CHINGRI, DRY KACHKI, DRY CHURI, DRY ILISH, DRY LOITTA, Rui, Sole, Batashi, Mirka, Ilish fish, Tilapia, Koi, Wallago Attu, Iliah fish, Kajuli fish, Kakila , Chapala fish, Prawn, Mola Carpet, Pomfret, Rupchada, Catla Fish, Taki Fish, Mohashol Fish, Boyal Fish, Nola fish, Baila Fish, Shor Puti Fish, Silver carp, Pua Fish, Chitala Fish, Nola Fish, Clown knifefish, Pangash Fish,&nbsp;</p>\r\n\r\n<h2><strong>Online Fish Shop Why Us</strong></h2>\r\n\r\n<ul>\r\n	<li>Massive fish collection, more choices</li>\r\n	<li>Extreme care while handling the fish</li>\r\n	<li>Hygiene guaranteed while processing and packaging</li>\r\n	<li>Fresh catch from rivers and sea, no preservatives added.&nbsp;</li>\r\n	<li>Correct weighing. You get what you pay for</li>\r\n	<li>Refund guaranteed if our fish turns out anything other than fresh</li>\r\n	<li>Flexible payment method</li>\r\n	<li>Less delivery charge and fast delivery.</li>\r\n</ul>', 1, 10),
